import React from "react";

function Contact() {
  return (
    <section>
      <h2>Contact</h2>
      <p>
        Feel free to reach out for collaborations or questions!
      </p>
      <ul>
        <li>Email: ishwarsathe67@gmail.com</li>
        <li>LinkedIn: https://www.linkedin.com/in/ishwar-sathe-132397169/</li>
      </ul>
    </section>
  );
}

export default Contact;
